import React, {useEffect, useState} from 'react';
import styles from './App.css';

function App() {
  var [previewQuestion, setPreviewQuestion] = useState("");
  var [previewQuestioner, setPreviewQuestioner] = useState("");
  var [currentQuestion, setCurrentQuestion] = useState("");
  var [currentQuestioner, setCurrentQuestioner] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/?question=4&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        console.log(data);
        setQuestioner(data.values[0][0]);
        setQuestion(data.values[0][1]);
      })
    );
  }, [])

  return (
    <div className="App">
      <form>
        <label>
          Preview Question
         <input type="text" name="preview" />
        </label>
        <input type="submit" value="Jump" />
     </form>
      <button className='yeet' onClick={function() { alert('click'); setQuestion("dad"); }}>
        Answer
      </button>
      <button className='yeet' onClick={function() { alert('click'); setQuestion("dad"); }}>
        Skip
      </button>
      <p className={styles.questioner}>{previewQuestioner}</p>
      <p className={styles.question}>{previewQuestion}</p>
      <p className={styles.questioner}>{currentQuestioner}</p>
      <p className={styles.question}>{currentQuestion}</p>
    </div>
  );
}

